/*Table structure for table `sys_fixed` */

DROP TABLE IF EXISTS `sys_fixed`;

CREATE TABLE `sys_fixed` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `fixed_code` varchar(50) DEFAULT NULL COMMENT '定区编号',
  `staff_id` int(11) DEFAULT NULL COMMENT '定区负责人',
  `fixed_name` varchar(50) DEFAULT NULL COMMENT '定区名字',
  `status` varchar(1) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

