/*Table structure for table `sys_partition` */

DROP TABLE IF EXISTS `sys_partition`;

CREATE TABLE `sys_partition` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '分区主键',
  `partition_code` varchar(32) DEFAULT NULL COMMENT '分区编号',
  `addresskey` varchar(50) DEFAULT NULL COMMENT '关键字',
  `single` int(4) DEFAULT NULL COMMENT '单双号',
  `address` varchar(50) DEFAULT NULL COMMENT '地址',
  `status` varchar(1) DEFAULT NULL COMMENT '状态',
  `province` varchar(30) DEFAULT NULL COMMENT '省',
  `city` varchar(30) DEFAULT NULL COMMENT '市',
  `village` varchar(30) DEFAULT NULL COMMENT '区',
  `fixed_id` int(11) DEFAULT NULL COMMENT '定区id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `sys_partition` */

insert  into `sys_partition`(`id`,`partition_code`,`addresskey`,`single`,`address`,`status`,`province`,`city`,`village`,`fixed_id`) values (1,'FQ001','城关镇',0,'凤瑞路110号','1','410000','411300','411322',1),(4,'FQ002','城关镇',1,'人民路110号','1','410000','411300','411322',1);

/*Table structure for table `t_driver` */

DROP TABLE IF EXISTS `t_driver`;

CREATE TABLE `t_driver` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(20) DEFAULT NULL COMMENT '司机姓名',
  `telephone` varchar(20) DEFAULT NULL COMMENT '司机手机号',
  `address` varchar(30) DEFAULT NULL COMMENT '司机住址',
  `status` varchar(1) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

