/*Table structure for table `t_organization` */

DROP TABLE IF EXISTS `t_organization`;

CREATE TABLE `t_organization` (
  `org_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '组织id',
  `org_name` varchar(30) DEFAULT NULL COMMENT '组织名字',
  `status` varchar(1) DEFAULT NULL COMMENT '是否停用 0停用 1启用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(20) DEFAULT NULL COMMENT '创建者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(20) DEFAULT NULL COMMENT '更新者',
  `remarks` varchar(50) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`org_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

